import React from 'react';
import axios from 'axios' 
import imgkonfhub from '../components/images/512.png'
import useForm from 'react-hook-form';

const style = {
    marginBottom:'10px',
    marginLeft: '10px',
    marginRight: '10px'
}

const apiId = 'https://dstc324xgg.execute-api.us-east-2.amazonaws.com/test/registration_authentication/gdgnag'


const getlogin = () => {
    axios.get(apiId)
    .then(function (response) {
      // handle success
       console.log(response);   
    })
}
const { register, handleSubmitLogin, errors } = useForm(); // initialise the hook
const onSubmit = data => {
    console.log(data);
  };

function checkLogin(){
    return(
        <div className="bodyLogin">
        <div className="has-text-centered ">
        <img  src={imgkonfhub}  height="62" width="62"/>
        </div>
        <form onSubmit={onSubmit}>
        <div style={style}>     
        <input className="input is-primary marginLR" name="id" placeholder='Event Id' ref={register({ required: true })} />
        {errors.id && 'Please enter event-id.'}
        </div>
        <div className="has-text-centered">
        <button className="button is-primary is-normal radiusBtn" type="submit">Login</button>
        </div>
        </form>
        </div>
    )
}
export default checkLogin;
